import React, { Component } from 'react'
import Navbar2 from './Navbar2'
import Footer from './Footer'
import { Breadcrumb } from 'react-bootstrap';
import '../CSS/style.css'

export default class About extends Component {
    render() {
        return (
            <div>
                <Navbar2/>

                <img className="d-block w-100" src={require('../media/about.jpg')} height="400px"  alt="1st image of our restaurant"/>
                <Breadcrumb>
                    <Breadcrumb.Item href="/"><h5 className="bread">Home</h5></Breadcrumb.Item>
                    <Breadcrumb.Item href="/about">
                        <h5 className="bread">About Us</h5>
                    </Breadcrumb.Item>
                    <Breadcrumb.Item active>Data</Breadcrumb.Item>
                </Breadcrumb>

                <Footer/>
            </div>  
        )
    }
}
